      out.write("\t//화면 비율에 따른 박스 크기 조절\n");
      out.write("\tfunction setWidgetPosition(){\n");
      out.write("\t\tvar screenWidth  = $(window).width();\n");
      out.write("\t\tvar bodyWidth    = (parent.top.frames[\"main\"].innerWidth);\n");
      out.write("\t\tvar bodyHeight   = (parent.top.frames[\"main\"].innerHeight);\n");
      out.write("\t\tvar footerHeight = $(\".wrap .mainfooter\").height();\n");
