      out.write("\t\tvar top   = screenWidth <= 1920?8:16;\n");
      out.write("\t\tvar left  = screenWidth <= 1920?8:16;\n");
      out.write("\t\tvar right = screenWidth <= 1920?8:16; \n");
      out.write("\t\tvar pad   = screenWidth <= 1920?10:15;\n");
      out.write("\t\t\n");
      out.write("\t\tvar widget1Width  = ((bodyWidth*3.6)/6.4 - left);\n");
      out.write("\t\tvar widget1Height = ((mainHeight*3.8)/6.2 - (top*2));\n");
      out.write("\t\t\n");
      out.write("\t\tvar widget2Width  = (bodyWidth - widget1Width) - (left*3);\n");
      out.write("\t\tvar widget2Height = (mainHeight/3) - (top*2);\n");
      out.write("\t\t\n");
      out.write("\t\t$(\".wrap\").css(\"height\",bodyHeight+\"px\");\n");
      out.write("\t\t$(\".wrap .main\").css(\"height\",mainHeight+\"px\");\n");
      out.write("\t\t$(\".wrap .main\").each(function(){\n");
      out.write("\t\t\tvar commonElementStyle = {\n");
      out.write("\t\t\t\t\t\tposition: \"absolute\",\n");
      out.write("\t\t\t\t\t\tbackground: \"#fff\",\n");
      out.write("\t\t\t\t\t\t\"border-radius\": \"5px\",\n");
      out.write("\t\t\t\t\t\t\"box-shadow\": \"2px 2px 2px 2px #e3e3e3\"\n");
      out.write("\t\t\t\t\t};\n");
      out.write("\t\t\tvar widget = $(this).find(\"div.widget\");\n");
      out.write("\t\t\twidget.css(commonElementStyle);\n");
      out.write("\t\t\t\n");
      out.write("\t\t\twidget.eq(0).css({\n");
      out.write("\t\t\t\twidth: widget1Width + \"px\",\n");
      out.write("\t\t\t\theight: widget1Height + \"px\",\n");
